import { useState, useEffect } from "react";

export default function Login() {
    const [login, setLogin] = useState('idealy@gmail.com');
    const [password, setPassword] = useState('login');

    function log() {
        alert("Email : "+login);
        alert("Password : "+password);

        window.location.href("/bsdbsdbsdbsd");
    }

    return(
        <div class="container">
            <div class="card shadow-lg o-hidden border-0 my-5">
                <div class="card-body p-0">
                    <div class="row justify-content-center">
                        <div class="col-lg-3">
                            <div class="p-5">
                                <div class="text-center">
                                    <h4 class="text-dark mb-4">Login</h4>
                                    <p>Veuillez vous connecter</p>
                                </div>
                                <br />
                                <form class="user" method="post">
                                    <div class="mb-3"><input class="form-control form-control-user" onChange={(e)=>{setLogin(e.target.value)}} type="email" id="exampleInputEmail" aria-describedby="emailHelp" placeholder="Enter Email Address..." value={login} name="email"/></div>
                                    <div class="mb-3"><input class="form-control form-control-user" onChange={(e)=>{setPassword(e.target.value)}} type="password" id="exampleInputPassword" value={password} placeholder="Password" name="password"/></div>
                                    <div class="mb-3">
                                    </div><button class="btn btn-primary d-block btn-user w-100" onClick={(e)=>{log()}} type="button">Login</button>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
